import React from 'react';

import { ReactComponent as Metamask } from '../images/icons/metamask-icon.svg';
import { ReactComponent as Wallet } from '../images/icons/wallet-icon.svg';

export const WALLET_CONFIG = {
  METAMASK: {
    icon: <Metamask />,
    title: "Metamask"
  },
  WALLET: {
    icon: <Wallet />,
    title: "Wallet"
  }
}
